void XComplexadder_InterruptEnable(XComplexadder *InstancePtr, u32 Mask) {
    u32 Register;

    Xil_AssertVoid(InstancePtr != NULL);
    Xil_AssertVoid(InstancePtr->IsReady == XIL_COMPONENT_IS_READY);

    Register =  XComplexadder_ReadReg(InstancePtr->Axilites_BaseAddress, XCOMPLEXADDER_AXILITES_ADDR_IER);
    XComplexadder_WriteReg(InstancePtr->Axilites_BaseAddress, XCOMPLEXADDER_AXILITES_ADDR_IER, Register | Mask);
}

void XComplexadder_InterruptDisable(XComplexadder *InstancePtr, u32 Mask) {
    u32 Register;

    Xil_AssertVoid(InstancePtr != NULL);
    Xil_AssertVoid(InstancePtr->IsReady == XIL_COMPONENT_IS_READY);

    Register =  XComplexadder_ReadReg(InstancePtr->Axilites_BaseAddress, XCOMPLEXADDER_AXILITES_ADDR_IER);
    XComplexadder_WriteReg(InstancePtr->Axilites_BaseAddress, XCOMPLEXADDER_AXILITES_ADDR_IER, Register & (~Mask));
}

void XComplexadder_InterruptClear(XComplexadder *InstancePtr, u32 Mask) {
    Xil_AssertVoid(InstancePtr != NULL);
    Xil_AssertVoid(InstancePtr->IsReady == XIL_COMPONENT_IS_READY);

    XComplexadder_WriteReg(InstancePtr->Axilites_BaseAddress, XCOMPLEXADDER_AXILITES_ADDR_ISR, Mask);
}

